import React, { Component } from "react";

import axios from "axios";

const FATORIAL_REST_API_URL = "http://localhost:8080/api/fatorials";

class FatorialComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      fatorials: [],
    };
  }

  componentDidMount() {
    axios.get(FATORIAL_REST_API_URL).then((response) => {
      this.setState({ fatorials: response.data });
    });
  }

  render() {
    return (
      <div>
        <h1 className="text-center">Fatorial List</h1>
        <table className="table table-striped">
          <thead>
            <tr>
              <td>Number</td>
              <td>Fatorial</td>
            </tr>
          </thead>
          <tbody>
            {this.state.fatorials.map((user) => (
              <tr key={user.id}>
                <td>user.number</td>
                <td>user.fatorial</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default FatorialComponent;
